import { useState, Fragment } from 'react';

const App = () => {

    // COMPONENT DATA
    const [local, set_local] = useState({
        good: 0,
        neutral: 0,
        bad: 0
    })

    return (
        <Fragment>
            <Header text={ 'Give Feedback' } />
            <Stats data={[
                ('Good', local.good),
                ('Neutral', local.neutral),
                ('Bad', local.bad)
            ]} />
        </Fragment>
    )
}

const Header = ({ text }) => { return (
    <h1>{ text }</h1>
)}

const Stats = ({ data }) => { console.log(data); return (
    <table>
        <thead>
        { data.map(row =>
            <tr key={ row[0] }>
                <td>{ row[0] }</td>
                <td>{ row[1] }</td>
            </tr>
        )}
        </thead>
    </table>
)}

export default App
